import React, { Component } from 'react';
import logo from './static/logo.png';
import './App.css';
import Button from "@material-ui/core/Button";
import { Link } from "react-router-dom";

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1 className="App-title">Auntie Stella</h1>
          <img src={logo} className="App-logo" alt="logo" />
          <p>
          </p>
          <Button
          style={{ margin: "10px"}}
          size= "large"
          variant="contained"
          color = "primary"
          onClick={() =>
            console.log("click")
          }
        >
          INDIVIDUAL
        </Button>

        <Button
        style={{ margin: "10px" }}
        size= "large"
        variant="contained"
        color= "primary"
        onClick={() =>
          console.log("click")
        }
      >
      FACILITATOR
      </Button>

      <Link to="/more"><MenuItem style={{paddingLeft: 13, textDecoration: 'none'}}> Team 1
      </MenuItem></Link>

          <a
            className="App-link"
            target="_blank"
            rel="noopener noreferrer"
          >
          </a>
        </header>
      </div>
    );
  }
}

export default App;
